const newClass = { school: '', section: '', grade: '', course: '', type: "", exitPermissions: "" }
export default function createClassReducer(praState = newClass, action) {
  const { type, data } = action
  switch (type) {
    case 'setSchool':
      const resl = { ...praState, ...data }

      return resl
    case 'setClass':
      console.log('1111');
      console.log({ ...praState });
      console.log(data);
      const resl1 = { ...praState, ...data }
      console.log(resl1);
      return resl1

    default:
      return praState
  }
}
